    false,nt"url": null,nt"notes": "This data set contains 1971-2000 mean annual
    precipitation estimates for west-central Nevada. This is a raster data set developed
    using the precipitation-zone method, which uses elevation-based regression equations
    to estimate mean annual precipitation for defined precipitation zones (Lopes and
    Medina, 2007.) This data set is based on the 30-meter National Elevation Dataset.
    Reference Cited Lopes, T.J., and Medina, R.L., 2007, Precipitation Zones of West-Central
    Nevada: Journal of Nevada Water Resources Association, v. 4, no 2, p. 21.",nt"license_title":
